<!--the taglib-angular-udf was generated where you need udf data-->
<div class="container">
  <h2 class="item-text">School registration form San Vicente de Paul</h2>
  <lib-angular-udf [udfData]="udfData.data" [udfFormGroup]="udfFormGroup" color="primary" class="item" (input)="getSearchChanges($event.target.value)" autocomplete="off"></lib-angular-udf>
  <ul class="list-item">
    <li>{{udfFormGroup.value | json}}</li>
  </ul>
  
</div>
<router-outlet></router-outlet>
